/* backtop.js */
$(function() {
    var doc = document.documentElement,
    body = document.body;
    var container = $(".inBg")[0];
    function left() {
        if (parseInt($(window).width()) - parseInt($(container).width()) < 20) {
            return container.offsetLeft + container.offsetWidth - 20
        } else {
            return container.offsetLeft + container.offsetWidth + 5
        }
    }
    var backtop = $("<div>", {
        "class": "go-topbtn",
        css: {
            left: left(),
            display: document.documentElement.scrollTop || document.body.scrollTop || "none"
        },
        click: function() {
        	document.documentElement.scrollTop = document.body.scrollTop = 0;
            backtop.fadeOut("slow")
        }
    }).appendTo("body");
    onresize = function() {
        backtop.css("left", left())
    };
    onscroll = function() {
        if (document.documentElement.scrollTop || document.body.scrollTop) {
            backtop.fadeIn("slow")
        } else {
            backtop.fadeOut("slow")
        }
    }
});
